import React from 'react'

class Form extends React.Component {
state={
    name
}


render() {
    return (
        <div>

      <form onSubmit={this.handleSubmit}>     
      <input name/>
      </form>  
      <button>submit</button>

        </div>
    )
}
}

export default Form
